import React, { useEffect, useState } from 'react';
import './navbar.css';

function Navbar() {
  const [activeLink, setActiveLink] = useState('');
  const [textColor, setTextColor] = useState('#000'); // Default text color

  // Function to calculate text color based on background
  const getTextColor = (backgroundColor) => {
    const r = parseInt(backgroundColor.slice(1, 3), 16);
    const g = parseInt(backgroundColor.slice(3, 5), 16);
    const b = parseInt(backgroundColor.slice(5, 7), 16);

    // Calculate luminance
    const luminance = (0.299 * r + 0.587 * g + 0.114 * b) / 255;

    // Return black for light backgrounds, white for dark backgrounds
    return luminance > 0.5 ? '#000' : '#FFF';
  };

  // Function to update navbar text color dynamically
  const updateNavbarTextColor = () => {
    const bodyBackgroundColor = window.getComputedStyle(document.body).backgroundColor;

    // Convert RGB to HEX
    const rgbValues = bodyBackgroundColor.match(/\d+/g);
    const hex =
      '#' +
      rgbValues
        .map((x) => parseInt(x).toString(16).padStart(2, '0'))
        .join('');

    setTextColor(getTextColor(hex));
  };

  useEffect(() => {
    // Update text color on load and scroll
    updateNavbarTextColor();
    window.addEventListener('scroll', updateNavbarTextColor);

    return () => {
      window.removeEventListener('scroll', updateNavbarTextColor);
    };
  }, []);

  // Function to handle link click and set active link
  const handleLinkClick = (e, section) => {
    setActiveLink(section);
  };

  return (
    <nav className="navbar" style={{ color: textColor }}>
      {/* Left Navbar */}
      <div className="navbar-right">
        <p>
          <a
            href="#home"
            className={activeLink === '#home' ? 'active' : ''}
            onClick={(e) => handleLinkClick(e, '#home')}
            style={{ color: textColor }}
          >
            Home
          </a>
          <a
            href="#aboutme"
            className={activeLink === '#aboutme' ? 'active' : ''}
            onClick={(e) => handleLinkClick(e, '#aboutme')}
            style={{ color: textColor }}
          >
            About
          </a>
          <a
            href="#projects"
            className={activeLink === '#projects' ? 'active' : ''}
            onClick={(e) => handleLinkClick(e, '#projects')}
            style={{ color: textColor }}
          >
            Projects
          </a>
          <a
            href="#chat"
            className={activeLink === '#chat' ? 'active' : ''}
            onClick={(e) => handleLinkClick(e, '#chat')}
            style={{ color: textColor }}
          >
            Chat with me
          </a>
        </p>
      </div>

      {/* Middle Navbar */}
      <div className="navbar-mid">
        <img src="/favicon.ico" alt="Logo" />
      </div>

      {/* Right Navbar */}
      <div className="navbar-left">
        <a
          href="https://www.linkedin.com/in/ploynapa-py/"
          target="_blank"
          rel="noopener noreferrer"
          className="tooltip-container"
        >
          <img aria-hidden src="/assests/lnl.png" alt="LinkedIn" id="github" />
          <span className="tooltip">LinkedIn</span>
        </a>

        <a
          href="https://github.com/Ploynpk"
          target="_blank"
          rel="noopener noreferrer"
          className="tooltip-container"
        >
          <img aria-hidden src="/assests/i.png" alt="GitHub" id="github" />
          <span className="tooltip">GitHub</span>
        </a>

        <a href="assests/PloynapaYang(Resume)-2025.pdf" rel="noopener noreferrer" className="tooltip-container">
          <img aria-hidden="true" src="/assests/rebtn.png" alt="Resume" id="github" />
          <span className="tooltip">Resume</span>
        </a>

        <a href="mailto:ploy@ploynapa.com" rel="noopener noreferrer" className="tooltip-container">
          <img aria-hidden="true" src="/assests/mr.png" alt="Contact Me" id="github" />
          <span className="tooltip">Contact Me</span>
        </a>
      </div>
    </nav>
  );
}

export default Navbar;
